s.reboot { s.options.numBuffers = 1024 * 256; s.options.memSize = 8192 * 32; s.options.numWireBufs = 128; s.options.maxNodes = 1024 * 32; s.options.numOutputBusChannels = 2; s.options.numInputBusChannels = 2; s.waitForBoot { ~dirt = SuperDirt(2, s); ~dirt.loadSoundFiles; ~dirt.loadSoundFiles("/Users/bubo/Dropbox/MUSIQUE/LIVE_SMC/DRUMS/*"); s.sync; ~dirt.start(57120, 0 ! 12); ( ~d1 = ~dirt.orbits[0]; ~d2 = ~dirt.orbits[1]; ~d3 = ~dirt.orbits[2]; ~d4 = ~dirt.orbits[3]; ~d5 = ~dirt.orbits[4]; ~d6 = ~dirt.orbits[5]; ~d7 = ~dirt.orbits[6]; ~d8 = ~dirt.orbits[7]; ~d9 = ~dirt.orbits[8]; ~d10 = ~dirt.orbits[9]; ~d11 = ~dirt.orbits[10]; ~d12 = ~dirt.orbits[11]; ); }; s.latency = 0.3;
};
) SuperDirt treats a wildcard (*) at the end of the path to mean that there are named subdirectories. If you want to load just one sample directory, omit the wildcard.

