iron.nvim is a modern plugin for handling REPLs from Neovim. It took me some time to configure but it works well too. install by following the instructions on the repository. copy/paste all the necessary configuration files and customize it to your liking. take note of the details below. For sending code blocks, you will have to customize your REPL a little more. Note that I am using Lua, the modern Neovim replacement to VimScript. Please look at the following amendments to the base configuration: local iron = require("iron.core")
iron.setup({ repl_open_cmd = "vertical botright 50 split", -- better split config = { -- Whether a repl should be discarded or not scratch_repl = false, close_window_on_exit = true, -- Your repl definitions come here repl_definition = { sh = { -- Can be a table or a function that -- returns a table (see below) command = { "zsh" }, python = { command = { "sardine" }, }, format = require("iron.fts.common").bracketed_paste, -- super important (!!!) }, }, -- How the repl window will be displayed -- See below for more information repl_open_cmd = require("iron.view").split.vertical.botright(50), }, -- ... etc ... your typical config
}) This will allow you to send the following events to the Sardine REPL: sending a single line: <space>sl with your cursor on the line you want to send. sending a code block : <space>sc with a selected block of text for multi-line.
